import styled from "styled-components";

export const CollectionPreviewStyles = styled.div`
  display: flex;
  flex-direction: column;
  margin-bottom: 30px;
`;

export const TitleStyles = styled.h1`
  ont-size: 28px;
  margin-bottom: 25px;
`;

export const PreviewStyles = styled.div`
  display: flex;
  justify-content: space-between;
`;
